import	React from 'react';
import Ball from '../Ball/Ball';

const CardList = ({ balls }) => {
  return (
    <div>
      {
        balls.map((ball, i) => {
          return (
            <Ball
              key={i}
              itemid={balls[i].itemid}
              itemname={balls[i].itemname}
              itemimage={balls[i].itemimage}
              />
          );
        })
      }
    </div>
  );
}

export default CardList;
